def _dijkstra(graph, node, target): 
    dist = {node: 0}
    predecessors = {node: None}
    open_list = [(0, node)]
    while open_list: 
        current = open_list.pop()
        if current[0] == dist[node]: 
            return current[1]
        for neighbor in graph[node]: 
            dist[neighbor] = current[0] + graph[node][neighbor]
            predecessors[neighbor] = node
            if dist[neighbor] <= target: 
                open_list.append((dist[neighbor], neighbor))
    return None
def min_cost(cost, x, y): 
    return min(cost[x][y], _dijkstra(cost, x, y))
