from collections import deque
def min_cost(graph, start, end): 
    cost = {}
    function = lambda x: sum(g for g in graph[x] if g > 0) 
    path = deque()
    cost[start] = function(start)
    for node in graph:
        for nextnode in graph[node]:
            cost[node] = min(cost[node], cost[nextnode]) + function(nextnode)
        path.append(node)
    return cost[end], path
